import React, { Component } from 'react'
import Layout from '../../components/Layout'

export class Inspire extends Component {
    render() {
        return (
            <React.Fragment>
                <Layout>
                <div className="outer_wrapper"></div>
                <div className="header">
                We love to create and inspire
                </div>
                <div className="inner_header">
                MEET OUR PEOPLE
                </div>
                <div className="rectangle1"></div>
                <div className="image1"></div>
                <img className="image1" src=""/>
                <div className="rectangle2"></div>
                <div className="image2"></div>
                <img className="image2" src="images/service.jpg"/>
                <div className="rectangle3"></div>
                <div className="image3"></div>
                <img className="image3" src=""/>
                <div className="rectangle4"></div>
                <div className="image4"></div>
                <img className="image4" src="images/employer.jpg"/>
                <div className="rectangle5"></div>
                <div className="image5"></div>
                <img className="image5" src=""/>
                <div className="rectangle6"></div>
                <div className="image6"></div>
                <img className="image6" src=""/>
                <div className="rectangle7"></div>
                <div className="image7"></div>
                <img className="image7" src=""/>
                <div className="rectangle8"></div>
                <div className="image8"></div>
                <img className="image8" src=""/>
                <style jsx>{`
                .outer_wrapper{
                    position: absolute;
                    width: 1299px;
                    height: 843px;
                    left: 0px;
                    top: 1925px;
                    border:1px solid black
                }
                .rectangle2{
                    position: absolute;
                    width: 400px;
                    height: 300px;
                    left: 534px;
                    top: 2067px;
                    background: #C4C4C4;
                }
                .image2{
                    position: absolute;
                    width: 420px;
                    height: 315px;
                    left: 524px;
                    top: 2062px;
                    background: url(working-for-an-owner-driven-business.png);
                }
                .rectangle3{
                    position: absolute;
                    width: 364px;
                    height: 364px;
                    left: 935px;
                    top: 2067px;
                    background: #C4C4C4;
                }
                .image3{
                    position: absolute;
                    width: 621px;
                    height: 414px;
                    left: 838px;
                    top: 2035px;
                    background: url(engineering-k4GI--621x414@LiveMint.jpg);
                }
                .rectangle4{
                    position: absolute;
                    width: 399px;
                    height: 399px;
                    left: 1px;
                    top: 2368px;
                    background: #C4C4C4;
                }
                .image4{
                    position: absolute;
                    width: 438px;
                    height: 432px;
                    left: 0px;
                    top: 2361px;
                    background: url(employer-danger-signs.jpg);
                }
                .rectangle5{
                    position: absolute;
                    width: 533px;
                    height: 400px;
                    left: 401px;
                    top: 2368px;
                    background: #C4C4C4;
                }
                .image5{
                    position: absolute;
                    width: 714px;
                    height: 401px;
                    left: 327px;
                    top: 2367px;
                    background: url(30353-employees-reuters.jpg);
                }
                .rectangle6{
                    position: absolute;
                    width: 364px;
                    height: 273px;
                    left: 935px;
                    top: 2432px;
                    background: #C4C4C4;
                }
                .image6{
                    position: absolute;
                    width: 700px;
                    height: 343px;
                    left: 918px;
                    top: 2424px;
                    background: url(image.png);
                }
                .rectangle7{
                    position: absolute;
                    width: 111px;
                    height: 62px;
                    left: 935px;
                    top: 2706px;
                    background: #C4C4C4;
                }
                .image7{
                    position: absolute;
                    width: 144px;
                    height: 96px;
                    left: 914px;
                    top: 2695px;
                    background: url(engineering-k4GI--621x414@LiveMint.jpg);
                }
                .rectangle8{
                    position: absolute;
                    width: 77px;
                    height: 62px;
                    left: 1110px;
                    top: 2706px;     
                    background: #C4C4C4;
                }
                .image8{
                    position: absolute;
                    width: 267px;
                    height: 150px;
                    left: 1187px;
                    top: 2617px;
                    background: url(30353-employees-reuters.jpg);
                }
                .rectangle1{
                    position: absolute;
                    width: 533px;
                    height: 300px;
                    left: 0px;
                    top: 2067px;
                    background: #C4C4C4;
                }
                .image1{
                    position: absolute;
                    width: 700px;
                    height: 343px;
                    left: -73px;
                    top: 2055px;
                    background: url(image.png);
                }
                .inner_header{
                    position: absolute;
                width: 180px;
                height: 21px;
                left: 571px;
                top: 2001px;
                font-family: Roboto;
                font-style: normal;
                font-weight: 900;
                font-size: 18px;
                line-height: 21px;
                color: #184A88;
                }
                .header{
                    position: absolute;
                    width: 613px;
                    height: 56px;
                    left: 344px;
                    top: 1925px;
                    font-family: Roboto;
                    font-style: normal;
                    font-weight: normal;
                    font-size: 48px;
                    line-height: 56px;
                    color: #333333;
                }
                `}</style>
                </Layout>
            </React.Fragment>
        )
    }
}

export default Inspire
